import logo from './logo.svg';
import './App.css';
import React, {useEffect, useState} from "react";
import {HashRouter, Route} from "react-router-dom";
import axios from "axios";
import User from './components/js/User.js'

function App() {


      const [apitest, setapitest] = useState(null);
      const [text, setText] = useState([])
      var tmp= [];
      function update(){

        axios({
          method: 'post',
          url: '/gettotalplayerlist', 
      }).then((response) => response.data, (error) => {
          console.log(error);
        }).then(users => {setText(users);console.log(users)});

      }
    useEffect(() => {update();const interval =setInterval(update,1000);return ()=>clearInterval(interval)}, []);
    console.log('here1');
    function test() {

      fetch("https://random-data-api.com/api/address/random_address")
      .then(response => response.json())
      .then(users => {

       setText(JSON.parse(users))


      })
    }
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>

         I survived : {
          (function (){
            if (text["playerInfoList"])return JSON.stringify(text["playerInfoList"][0]["survivalTime"]) ;
            else return ("0");
          })()} units of whaterver unit of measurement this game uses :P
        </p>
        {

          (function(){

            if (text["playerInfoList"]!== undefined){

              text["playerInfoList"].map((x,y)=>{console.log(x);return (<p>Player :{x["playerName"]} :{JSON.stringify(x["marchDistance"])}</p>) })
            }
            else return ("hi")
          })()

        }
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
